import React from 'react';
import styles from './Status.module.css';
import {MdFormatQuote, MdPhotoCamera} from 'react-icons/md';
import {RiShareBoxLine} from 'react-icons/ri';
import RoundWrapper from '../../components/util/RoundWrapper';

const Status = () => {
    return (
        <div className={styles.container}>
            <ul className={styles.list_items}>
                <li className={styles.item}>
                    <RoundWrapper diameter='40px' bgcolor='#EAEAF1'>
                        <MdFormatQuote />
                    </RoundWrapper>
                </li>
                <li className={styles.item}>2</li>
                <li className={styles.item}>3</li>
            </ul>
            <form action="" method="post" className={styles.form}>
                <input type="text" name="" id="" />
                
            </form>
        </div>
    )
}

export default Status
